data.text:
@StojBoj All the best cynics are optimists at heart! 

You can only be that cyclical when life has smashed your hopes! 

And then the optimist in you sends you out to get smashed some more!!

@StojBoj I hear you.

The thing that would worry me most is if educators got hold of the subject, and filled it full of meaningless junk only designed to be useful for an exam!

But there’s plenty of basics. And could stretch all the way to entrepreneurship.

@StojBoj Can I ask what your objection is?

Other than it could/should be taught at home, why shouldn’t it be taught at school? 

Ineffectiveness isn’t a great answer either. I haven’t personally turned into a great footballer or musician despite school’s best efforts!
